import './header.css';

function Header() {
  return (
    <nav>
      <div className="hamburger-menu">
        <div className="line line-1"></div>
        <div className="line line-2"></div>
        <div className="line line-3"></div>
      </div>
      <ul>
        <li>
          <a href="#">Projects</a>
        </li>
        <li>
          <a href="#">Projects</a>
        </li>
        <li>
          <a href="#">Projects</a>
        </li>
      </ul>
    </nav>
  );
}

export default Header;
